import React from "react";
import pirateGirl from "./pirate_girl.png"; // Assurez-vous que le chemin est correct

// Exemple de données pour les agents IA
const agentsData = [
  {
    id: 1,
    name: "Pirate Girl",
    image: pirateGirl,
  },
  {
    id: 2,
    name: "Agent Beta",
    image: "https://via.placeholder.com/300x200?text=Beta",
  },
  {
    id: 3,
    name: "Agent Gamma",
    image: "https://via.placeholder.com/300x200?text=Gamma",
  },
  {
    id: 4,
    name: "Agent Delta",
    image: "https://via.placeholder.com/300x200?text=Delta",
  },
  {
    id: 5,
    name: "Agent Epsilon",
    image: "https://via.placeholder.com/300x200?text=Epsilon",
  },
  {
    id: 6,
    name: "Agent Zeta",
    image: "https://via.placeholder.com/300x200?text=Zeta",
  },
  {
    id: 7,
    name: "Agent Eta",
    image: "https://via.placeholder.com/300x200?text=Eta",
  },
  {
    id: 8,
    name: "Agent Theta",
    image: "https://via.placeholder.com/300x200?text=Theta",
  },
  {
    id: 9,
    name: "Agent Iota",
    image: "https://via.placeholder.com/300x200?text=Iota",
  },
];

function AIAgents() {
  // Conteneur principal occupant 90% de la largeur de la page
  const containerStyle = {
    width: "90%",
    margin: "0 auto",
    padding: "20px",
  };

  // Grille à 3 colonnes pour afficher les agents
  const gridStyle = {
    display: "grid",
    gridTemplateColumns: "repeat(3, 1fr)",
    gap: "20px",
    marginTop: "20px",
  };

  // Style de la card pour l'image (sans padding pour que l'image occupe tout l'espace)
  const cardStyle = {
    backgroundColor: "#f9f9f9",
    borderRadius: "8px",
    overflow: "hidden", // Pour que l'image respecte les bords arrondis
    boxShadow: "0 2px 8px rgba(0, 0, 0, 0.1)",
  };

  // L'image occupe toute la largeur de la card
  const imageStyle = {
    width: "100%",
    height: "auto",
    display: "block",
  };

  // Style du nom affiché en dehors de la card
  const nameStyle = {
    marginTop: "10px",
    fontSize: "1.2rem",
    fontWeight: "bold",
  };

  return (
    <div style={containerStyle}>
      <h1 style={{ textAlign: "center" }}>Catalogue des Agents IA</h1>
      <div style={gridStyle}>
        {agentsData.map((agent) => (
          <div key={agent.id} style={{ textAlign: "center" }}>
            {/* La card contient uniquement l'image */}
            <div style={cardStyle}>
              <img src={agent.image} alt={agent.name} style={imageStyle} />
            </div>
            {/* Le nom de l'agent est affiché en dessous, en dehors de la card */}
            <div style={nameStyle}>{agent.name}</div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default AIAgents;
